@VelocitySkyz So to get all of these, you must have 921 Robux.
To put that in perspective, buying the minimal amount of Robux (800 for 9.99$ via a 10$ Roblox Gift Card) won't get you to the amount of Robux needed if you wanted to buy them alone.
Very pricey for items that aren't that good IMO.
